import React from 'react';

export default function PredictionResult({ data }) {
  return (
    <div className="result">
      <h2>Prediction</h2>
      <p><strong>Disease:</strong> {data.predicted_disease}</p>
      {data.top_predictions && data.top_predictions.length > 0 && (
        <table className="prob-table">
          <thead>
            <tr><th>Disease</th><th>Probability</th></tr>
          </thead>
          <tbody>
            {data.top_predictions.map(row => (
              <tr key={row.disease}><td>{row.disease}</td><td>{(row.probability * 100).toFixed(2)}%</td></tr>
            ))}
          </tbody>
        </table>
      )}
      <p><strong>Input Symptoms:</strong> {data.input_symptoms.join(', ') || 'None'}</p>
    </div>
  );
}
